var obj = response_body;
var res = [];

if(obj.feed.entry){
  obj.feed.entry.forEach((event, index) => {
    if(event.category['@term'] == 'EmployeeHired'){
      let full_event = JSON.parse(event.content);
      res.push(full_event);
    }
	});
}

done({
  "response_body": res
});

var exprs = request_expression; 
//exprs = [ { "value": ..., "operator": ..., "attribute": ... }]
var res_path = '/employee/';
var res_date = null;

if(exprs && exprs.length){
  exprs.forEach((param, index) => {
    if(param.attribute == 'date'&& param.operator == '='){
       res_date = param.value;
    }
  });
}

if(!res_date){
	//lets grab today in YYYY-MM-DD format;
  var today = new Date();
  var y = today.getFullYear();
  var m = today.getMonth() + 1;
  var d = today.getDate();
  res_date = y + '-'+ (m < 10 ? '0' : '') + m + '-' +
    									 (d < 10 ? '0' : '') + d;
}

res_path += res_date;

done({
    'request_vendor_path': res_path,
    'continue': true
});

